window.bookSummaryJSON = "<p><b>Jace Blackbriar just wants to become a blacksmith and live a comfortable life in his village. His family never wanted him to become an adventurer...and he isn't going to break that promise.</b></p> <p>Jace wants to learn to make goods that pay well so that he can support himself, and maybe even send some money to his family. His goal is to gain the blacksmith class and start his own forge. But then, one of the other apprentices decides he needs to be taught a lesson.</p> <p>When a rare and valuable magic item is destroyed, Jace is left with a racial transformation and cast into the wilds without guidance. Now, he has to figure out how to survive in a kill-or-be-killed world as a monster race that most goodly folk will want dead. </p> <p><i>Accidental Incubus</i> contains explicit elements and some adult content.</p>"; 
